description:
Radium 2 (Split Scenes)

Dana DeArmond, Tera Wray, Camryn Kiss, Kristina Rose, Devon (i), Rick Masters, Mark Zane, Jenner

Follow Tera Wray as she travels the countryside interviewing serious metal acts that continue to destroy everything in their path. In this episode you will see interviews with Ill Nino, In This Moment, and Society 1. You even get to go into the studio to see a platinum selling mystery metal guest lay down some tracks for an all new original theme song. If this isn't enough, follow Tera to Houston to witness Matt Zane's guitar suspension performance and don't forget: This is the only metal series with the hottest metal chicks getting fucked!

